import {Link, Box, VStack, Text} from 'native-base';

import TitleBar from '../General/TitleBar';
import HMP from './HMP';
import TrendingBox from './trending';
import MeteoWidget from './meteo';

import InfoBox from './info';

function MyPlants(props){

    return(
     <Box>
      <VStack>
        <TitleBar name='My Plants'/>
        {props.userplants.map(up=><PlantBox/>)}
      </VStack>
     
    </Box>

    );
}

function PlantBox(props){}




export default MyPlants;
